class peg$DefaultTracer {
  constructor() {
    this.indentLevel = 0;
  }

  trace(event) {
    const that = this;

    function log(event) {
      console?.log?.(
        event.location.start.line + ":" + event.location.start.column + "-"
          + event.location.end.line + ":" + event.location.end.column + " "
          + event.type.padEnd(10, " ")
          + "".padEnd((that.indentLevel * 2) + 1, " ") + event.rule
       );
    }

    switch (event.type) {
      case "rule.enter":
        log(event);
        this.indentLevel++;
        break;

      case "rule.match":
        this.indentLevel--;
        log(event);
        break;

      case "rule.fail":
        this.indentLevel--;
        log(event);
        break;

      default:
        throw new Error("Invalid event type: " + event.type + ".");
    }
  }
}

